import React from 'react';
import Comment from "./Comment";
import {StyleSheet, css} from 'aphrodite';
import {ScrollButton, Axis} from "../../helpers/ScrollButton";

function Comments(props) {
    const style = StyleSheet.create({
        edgesMargin: {
            marginRight:"10%",
            marginLeft :"10%",
            marginTop:"5%"
        }
    })
    return (
        <div className={css(style.edgesMargin) + " row"}>
            <Comment/>
            <Comment/>
            <div className="row">
                <ScrollButton axis={Axis.HORIZONTAL}/>
                <ScrollButton axis={Axis.HORIZONTAL}/>
                <ScrollButton axis={Axis.HORIZONTAL} selected={true}/>
                <ScrollButton axis={Axis.HORIZONTAL}/>
            </div>
        </div>
    );
}

export default Comments;
